import { EventForm } from "../components";
import { useLoaderData, useRouteLoaderData } from "react-router-dom";

const EditEventPage = () => {
  const data = useRouteLoaderData("event-detail");
  return <EventForm event={data.event} />;
};

export default EditEventPage;
